class Solution:
    def maxOperations(self, s: str) -> int:
        num_ones = 0
        i = 0
        num_operations = 0
        while i < len(s):
            if s[i] == '1':
                old = i
                i += 1
                while i < len(s) and s[i] != '1':
                    i += 1
                num_ones += 1
                if i != old + 1:
                    num_operations += num_ones
            else:
                i += 1

        return num_operations
